import React from 'react'
import Tree, { useTreeState } from 'react-hyper-tree'
 
const data = {
  id: 1,
  name: 'Parent 1',
  children: [
    {
      id: 2,
      name: 'Child 1',
      children: [
        {
          id: 5,
          name: 'Child 1__1',
        },
        {
          id: 6,
          name: 'Child 1__2',
        },
        {
          id: 7,
          name: 'Child 1__3',
        },
      ],
    },
  ],
}
  
const Menu = () => {
  const { required, handlers } = useTreeState({
    data,
    id: 'your_tree_id',
  })
 
  return (
    <Tree
      {...required}
      {...handlers}
    />
  )
}
